let obj = {}


obj.get2 = (url, postData) => {
    return window.jQuery.when(window.jQuery.ajax({
        method: "post",
        url: url,
        data: postData,
        dataType: "json"
      }))
      .done((rs) => {
          console.log(rs)
      });
}

export default obj;
